import Api from "../../services/api";
import React, { Component,setState } from 'react'


export default function Home() {

    //state = {};

    function componentDidMount(){
        const config = {
            headers:{
                Authorization: localStorage.getItem('token')
            }

            
        }
        Api.get('user', config).then(
            res =>{
                this.setState({
                    user:res.data
                })  
            },
            err =>{
                console.log(err);
            }
        )

    };

    
        return (

            

            <div>
                <h1>Ol</h1>
            </div>
        )
   
}
